import React from 'react'
import styled from '@emotion/styled'

const Container = styled.div`
    display: flex;
    flex-flow: column wrap;
    border: 1px solid black;
    padding: 20px;
`

const Emoji = styled.div`
    font-size: 50px;
`



const Card = ({ emoji }) => {
    return (
        <Container>
            <Emoji>{emoji}</Emoji>
        </Container>
    );
}

export default Card;
